import React from 'react';
import Cards from '../../components/cards/cards';
import "./home.css"


const home = () => {

const improvisando = [{
    title:"Santiago",
    image:"123",
    healthScore:"111",
    analyzedInstructions:"paso1",
    summary:"san"

}]

  return (
    <div className='home-cont'>
        <h1>FOOD</h1>
        <div>
            <Cards info={improvisando}/>
        </div>
    </div>
  )
}

export default home
